/**
 * @name parsing
 * @author JungHyunKwon
 * @since 2017-12-06
 * @version 1.0.0
 * @param {string} value
 * @param {string} from
 * @param {string} to
 * @param {number} index
 * @return {object || array}
 */
try{!function(){"use strict";window.parsing=function(n,r,t,e){var i={};if("string"==typeof n){var f=n.indexOf(r,e);if(f>-1){var o=f+r.length,s=n.indexOf(t,o);s>-1&&(i.value=n.substring(o,s),i.fromIndex=o,i.toIndex=s)}}return i},window.parsingAll=function(n,r,t){var e=[];if("string"==typeof n&&"string"==typeof r&&"string"==typeof t)for(var i=0,f=0,o=0;(i=n.indexOf(r,i))>-1;)o=i+r.length,(f=n.indexOf(t,o))>-1&&(e.push({value:n.substring(o,f),fromIndex:o,toIndex:f}),i=f+1);return e}}()}catch(n){console.error(n)}